import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { toast } from 'react-toastify';
import './Home.css';

const Home = () => {
  const [featuredProducts, setFeaturedProducts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadFeaturedProducts();
  }, []);

  const loadFeaturedProducts = async () => {
    try {
      const response = await axios.get('/products');
      // Get first 6 products as featured
      setFeaturedProducts(response.data.slice(0, 6));
    } catch (error) {
      console.error('Error loading products:', error);
      toast.error('Failed to load featured products');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="home">
      {/* Hero Section */}
      <section
        className="hero hero--image"
        style={{
          backgroundImage:
            "linear-gradient(0deg, rgba(0,0,0,0.45), rgba(0,0,0,0.45)), url('/hero-rslaf.jpg')",
          backgroundSize: 'cover',
          backgroundPosition: 'center',
        }}
      >
        <div className="hero-content">
          <h1>Professional Construction Equipment Rental</h1>
          <p>Access premium construction machinery for your projects. From excavators to cranes, we provide reliable equipment with competitive rates and professional service.</p>
          <div className="hero-actions">
            <Link to="/products" className="btn btn-primary">
              Browse Equipment
            </Link>
            <Link to="/register" className="btn btn-secondary">
              Get Started
            </Link>
          </div>
        </div>
        <div className="hero-image"></div>
      </section>

      {/* Features Section */}
      <section className="features">
        <div className="container">
          <h2>Why Choose RSLAF Rentals?</h2>
          <div className="features-grid">
            <div className="feature-card">
              <div className="feature-icon">âœ…</div>
              <h3>Quality Equipment</h3>
              <p>All our machinery is regularly maintained and inspected to ensure optimal performance.</p>
            </div>
            <div className="feature-card">
              <div className="feature-icon">ðŸ“…</div>
              <h3>Flexible Booking</h3>
              <p>Easy online booking system with flexible rental periods to match your project needs.</p>
            </div>
            <div className="feature-card">
              <div className="feature-icon">ðŸ“ž</div>
              <h3>24/7 Support</h3>
              <p>Professional support team available around the clock for any assistance you need.</p>
            </div>
          </div>
        </div>
      </section>

      {/* Featured Products Section */}
      <section className="featured-products">
        <div className="container">
          <h2>Featured Products</h2>
          {loading ? (
            <div className="loading">Loading featured products...</div>
          ) : featuredProducts.length > 0 ? (
            <div className="products-grid">
              {featuredProducts.map(product => (
                <div key={product.id} className="product-card">
                  <div className="product-image">
                    <div className="product-placeholder">
                      {product.name.charAt(0)}
                    </div>
                  </div>
                  <div className="product-info">
                    <h3>{product.name}</h3>
                    <p className="product-description">{product.description}</p>
                    <div className="product-price">
                      <span className="price">${product.daily_rate}/day</span>
                    </div>
                    <Link to={`/products/${product.id}`} className="btn btn-outline">
                      View Details
                    </Link>
                  </div>
                </div>
              ))}
            </div>
          ) : (
            <div className="no-products">
              <p>No products available at the moment.</p>
              <Link to="/products" className="btn btn-primary">
                View All Products
              </Link>
            </div>
          )}
        </div>
      </section>

      {/* CTA Section */}
      <section className="cta">
        <div className="container">
          <h2>Ready to Get Started?</h2>
          <p>Join contractors who trust RSLAF Rentals for reliable equipment and service.</p>
          <div className="cta-actions">
            <Link to="/register" className="btn btn-primary">
              Create Account
            </Link>
            <Link to="/products" className="btn btn-outline">
              Browse Equipment
            </Link>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
